const App = () => {
  return (
    <div className="logs">
      <div className="item">
        <div className="date">new Date(2021,2,3)</div>
        <div className="desc">学习书法</div>
        <div className="time">55分钟</div>
      </div>
    </div>
  );
};
export default App;
